import React from 'react';

class SearchBar extends React.Component {



	render() {
		return (
			<div className="ui segment">
				<form class="ui form">
					<div class="field">
						<label>Enter Location</label>
						<input type="text" name="location" placeholder="Enter Location"></input>
					</div>
				</form>
			</div>
		);
	}
}

export default SearchBar;
